❆ EU TUV ISO13485 tulaga lelei tusi faamaonia ma USA FDA faamaonia falegaosimea;
❆ E sili atu i le 30 NMPA tusi resitala masini faafomai i Saina;
❆ O le Novel Coronavirus Test Kit ua faʻamaonia e le US FDA EUA, EU CE, French ANSM, Netherlands, Siamani BfArM, Austria, Ausetalia TGA, Brazil ANVISA, Bolivia, Peru, Thailand, Filipaina, Indonesia, Malaysia ma isi pulega o le lalolagi ma fa'apu'upu'u i le lisi pa'epa'e o tagata fa'aulufale mai, a'o le resitalaina i Saina NMPA, WHO ma isi resitala fa'atasi o lo'o fa'agasolo.
❆ O le vaega muamua o oloa su'esu'e a le tagata lava ia coronavirus a Siamani ua tu'uina i le lisi o pisinisi a le BfArM.
❆ O oloa su'esu'e vaila'au ua lisiina i totonu o le "Matagaluega o le Puipuiga o Tagata Lautele Fualaau Su'ega Pusa (taila) fautuaina le Fa'atauga Catalogue";
❆ Laihe Biotech su'esu'e ma atina'e tuto'atasi le "Quantum Dot Fluorescence - o se tulaga fa'atekonolosi fa'afouga mo Hair Drug Trace Rapid Detection" lea e pei o le "13th Five-Year" poloketi R&D autu a le atunu'u, o lo'o avea ma vaega galulue fa'apisinisi mo le su'esu'eina o fualaau fa'asaina ma fualaau fa'asaina. fa'aoga fa'aoga tekinolosi & masini su'esu'e galuega autu autu 5 i'uga o su'esu'ega;
❆ Pateni Maua: sili atu i le 30 pateni fa'avaomalo ma Saina.

O le masini fa'amama ultrasonic fa'amama atoatoa e fetaui lelei mo le fa'amamāina o vaega ta'avale, vaega o le compressor, mea fa'aoga, ma le fa'amomoli o vaega a'o le'i fa'apotopotoga pe a uma le masini.
1. O le PLC otometi faʻatonuina faʻatonuga, faʻatasi ma le lima robotic, e sili atu le sologa lelei;
2. Fa'atulaga se masini togi e fa'amautinoa ai le mama toniga;
3. Faʻamaualuga maualuga le vevela, faʻamagoina faʻamagoina maualuga, faʻatasi ai ma le mama ma leai ni vai stains i luga o le mea faigaluega;
4. O le masini faʻamama ultrasonic o loʻo faʻapipiʻiina atoa le sila ma le faʻaogaina o le tino, ma le siosiomaga sili ona lelei.
I le gaosiga o atinaʻe i le lumanaʻi, o le a suia ai le faʻamamaina o tusi lesona masani, faʻafefe, ma le faʻamamaina o kerosene, ma ua faʻaaogaina lautele i le eletise, faʻapipiʻi ion, vaega taʻavale, optics, matamata, filo vailaʻau, LCD, meafaigaluega, textiles, teuga, eletise ma eletise. alamanuia vaega, alamanuia tau vailaau, vaega opitika, alamanuia microelectronics, faailoga u'amea, vaega masini, vaega u'amea meafale, masini eletise eletise, ma isi.
